import { Table, Row, Col, Container, Button } from "react-bootstrap";
import Clinic from "./Clinic";
import "./Clinic.css";
function Tr(props) {
  return (
    <tr>
      <th>#</th>
      <th>{props.name}</th>
      <th>{props.phone}</th>
      <th>{props.email}</th>
      <th>{props.city}</th>
      <th>{props.account}</th>
      <th>{props.date}</th>
      <th>
        <Button
          variant="outline-primary"
          size="sm"
          onClick={setModalShow(true)}
        >
          Edit
        </Button>
      </th>
      <th>
        <Button variant="outline-primary" size="sm">
          Delete
        </Button>
      </th>
    </tr>
  );
}

export default Tr;
